import React, { Component } from "react";
import { WrapIcon } from "mdi-react";

class Home extends Component {
  componentDidMount() {
    this.getBoys();
  }

  getBoys() {
    const boys = req.get("http://localhost:5000/api/boys/");
    console.log(boys);
  }

  render() {
    return (
      <>
        <div />
        <h1>Se mig nøgen</h1>
        <p />
        <p>
          En ny undersøgelse viser at drenge i 7 klasse er mere
          kropsforskrækkede end tidligere.
        </p>
        <p>
          Se-mig-nøgen er et program som har til formål at gøre drenge i 7 B
          mere fortrolige med deres kroppe. Drengene fik i seksualundervisning
          til opgave at lave en pose og en profil. Af den opgave udsprang sitet
          Se mig nøgen.
        </p>
        <p>
          Drengene kan en profil, med billede og tekst, og andre kan studere
          billederne og sende kommentarer. Drengene kan også kontakte de andre
          drengene direkte.
        </p>
        <div
          style={{
            width: "100%",
            display: "flex",
            flexWrap: "wrap"
          }}
        >
          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={
                process.env.PUBLIC_URL +
                "/profileImages/hjkhjjgghg_9894502_30698897.jpg"
              }
            />
            <h3>Sebastian, 14 år</h3>
            <p>
              Jeg hedder Sebastian. Jeg er 14 år og i min fritid spiller jeg
              trommer. Nogle gange går jeg nøgen rundt, når jeg er alene hjemme.
            </p>
          </div>
          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={process.env.PUBLIC_URL + "/profileImages/6512729.jpg"}
            />
            <h3>Oliver, 14 år</h3>
            <p>Jeg kan godt lide et karbad, når jeg er alene hjemme. </p>
          </div>
          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={
                process.env.PUBLIC_URL +
                "/profileImages/096jpg_8382897_31103527.jpg"
              }
            />
            <h3>Emil, 14 år</h3>
            <p>
              Jeg syntes, det var ret flovt først, men efter et stykke tid
              føltes det næsten helt almindeligt.
            </p>
          </div>

          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={
                process.env.PUBLIC_URL +
                "/profileImages/fghdgfedfj_5612053_30661609.jpg"
              }
            />
            <h3>Marcus, 15 år</h3>
            <p>
              Jeg finder et øde sted udenfor, hvor jeg kan tage solbad. Jeg kan
              ikke lide, når der er linjer.
            </p>
          </div>
          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={
                process.env.PUBLIC_URL +
                "/profileImages/dfgshgdhgf_5255880_30631119.jpg"
              }
            />
            <h3>Marc, 13 år</h3>
          </div>
          <div style={{ width: "100%" }}>
            <img
              style={{ width: "100%", marginRight: "0.5rem" }}
              src={
                process.env.PUBLIC_URL +
                "/profileImages/Duval075jp_3347155_30643722.jpg"
              }
            />
            <h3>Cristoffer, 14 år</h3>
          </div>
        </div>
      </>
    );
  }
}

export default Home;
